                            <p dir="ltr">The word &ldquo;visual analytics&rdquo; has been gaining popularity, both in data science and business communities, for its increasing usefulness in understanding and relaying information.&nbsp; While it&rsquo;s closely related to data visualization as a concept, visual analytics is slightly different in that visual representation of data isn&rsquo;t just the final product but an integral part of the entire process.&nbsp;</p><br><br>
<p dir="ltr">Put simply, visual analytics is the means of exploring and analyzing data sets entirely within a visual interface. Rather than using solely numbers and text to represent information, visual analytics uses symbols, colors and even animations to manipulate and display data-based information.&nbsp;</p><br><br>
<p dir="ltr">Visual analytics can be as simple as color coding text or cells in a spreadsheet, or as complex as rendering a 3D model of the world. Oftentimes visual analytics takes the form of an interactive data dashboard. It&rsquo;s truly whatever helps you and your audience more quickly and clearly understand and convey the desired information.&nbsp;</p>
<h2 dir="ltr">Why Visual Analytics Can Help Your Business</h2>
<p dir="ltr">Visual analytics helps your business by showing trends and other relevant data-based insights as quickly and clearly as possible.&nbsp;</p>
<p><strong>&nbsp;</strong></p>
<p dir="ltr">It&rsquo;s important to remember that despite our highly evolved forms of verbal and written communication, human brains evolved to process visual information roughly <a href="https://blog.csgsolutions.com/15-statistics-prove-power-data-visualization">60,000 times faster than text.</a> Leveraging this fact by converting information into easily digestible visual form can help you process and communicate information faster than the competition&mdash;saving your business time and money.&nbsp;</p>
<p><strong>&nbsp;</strong></p>
<p dir="ltr">If you don&rsquo;t think your business needs visual analytics consider the following statistics: <br><br></p>
<ul>
<li dir="ltr" aria-level="1">
<p dir="ltr" role="presentation"><a href="https://www.amanet.org/articles/using-visual-language-to-create-the-case-for-change/">The Wharton School of Business found that data visualization</a> could shorten meetings by 23%. <br><br></p>
</li>
<li dir="ltr" aria-level="1">
<p dir="ltr" role="presentation">According to Bain &amp; Co, companies with advanced analytics capabilities are <a href="https://www.bain.com/insights/big_data_the_organizational_challenge">5x more likely to make faster</a> decisions than their peers. <br><br></p>
</li>
<li dir="ltr" aria-level="1">
<p dir="ltr" role="presentation">An estimated <a href="https://www.forrester.com/blogs/hadoop-is-datas-darling-for-a-reason/">73% of data goes unused for analytics purposes</a>. Around <a href="https://findstack.com/big-data-statistics/">63% of companies</a> can&rsquo;t even gather insights from big data. <br><br></p>
</li>
<li dir="ltr" aria-level="1">
<p dir="ltr" role="presentation">Poor and unused data costs US businesses roughly <a href="https://www.informationweek.com/big-data-analytics/big-data-analytics-sales-will-reach-187-billion-by-2019">$3.1 trillion a year</a>.&nbsp;</p>
</li>
</ul>
<p><strong>&nbsp;</strong></p>
<p dir="ltr">Put it all together and what becomes obvious is that better data visualization and better visual analytics are not only a business improvement, but a business necessity&mdash; uncovering hidden earning potential while streamlining insights and key benchmarks.&nbsp;</p>
<p><strong>&nbsp;</strong></p>
<p dir="ltr">It&rsquo;s truly the miracle tool of modern times.&nbsp;</p>
<h2 dir="ltr">What Type of Questions Does Visual Analytics Seek To Answer?</h2>
<p dir="ltr">Visual analytics is used to answer virtually any question where data intersects with actionable insight. Typically these will be uniform data sets with finite values, such as sales or marketing data&mdash;as opposed to something open ended like names, or survey responses.&nbsp;</p>
<p><strong>&nbsp;</strong></p>
<p dir="ltr">A couple types of questions that visual analytics can answer:&nbsp;</p>
<p><strong>&nbsp;</strong></p>
<h3 dir="ltr" style="text-align:left;"><strong>Supply Chain Visibility</strong></h3>
<p><strong>&nbsp;</strong></p>
<p dir="ltr">​​Visual analytics can help store or warehouse managers easily oversee inventory by location, or product type. Color codes can help show high and low inventory levels, while map overlays can help show exactly where those items are located, merging disparate data sources into one stream.&nbsp;</p>
<p><strong>&nbsp;</strong></p>
<p dir="ltr"><img style="display: block; margin-left: auto; margin-right: auto;" src="https://lh5.googleusercontent.com/5W8HFpZfpDOM9MGYKSDKxpG4NgZZWjbur8PfrT0HbNTkbe2Oj4-p_hgJSUv2Vqxkc1i0jCMyHQ8XHww9u3ht3-Gm0RsuF5eTVqq2Bx2ACEqr_EDUzm0nlrmWuUx5HjF1KT46F-HJvhfH11TWgnTfcC4" width="330" height="236"></p>
<p dir="ltr" style="text-align: center;"><em><span style="font-size: 10pt;">A visual distribution of store inventory by items in store (source: Qlik)</span></em></p>
<p><strong>&nbsp;</strong></p>
<h3 dir="ltr" style="text-align:left;"><strong>Marketing/Customer Acquisition</strong></h3>
<p dir="ltr">Visual analytics is great for boosting ROI on marketing campaigns, by illuminating data of each customer phase and their life cycle. Quickly see customer drop off points, geographic or demographic trends, or what campaigns are delivering the highest engagement, all without needing to search through large sets of numbers.&nbsp;&nbsp;</p>
<p><strong>&nbsp;</strong></p>
<h3 dir="ltr" style="text-align:left;"><strong>Financial Analysis&nbsp;</strong></h3>
<p dir="ltr">One of the main benefits of visual analytics is being able to help easily show data distribution. In the case of financial analysts, bar charts or scatter plots can show breakdowns of individual loans or loan applicants within a larger bundled portfolio.This is particularly useful in a portfolio with very diverse inputs as the distribution of risk and margin provide a much clearer picture than a mean or median would with only one value.&nbsp;</p>
<h2 dir="ltr">Key Methods to Quickly Increase The Effectiveness of Your Visual Analytics</h2>
<p dir="ltr">One of the most effective techniques in visual analytics and data visualization is the use of &ldquo;pre-attentive attributes&rdquo;.&nbsp; This refers to information we process immediately without needing to think to understand it.&nbsp;</p>
<p dir="ltr">The use of pre-attentive attributes is so common, you come across them everyday without realizing. A red octagon sign means stop. Green stock tickers mean prices are up. Multiple chili peppers on a menu denotes spicy.&nbsp;</p>
<p dir="ltr">Using pre-attentive attributes is extremely effective for helping to streamline information, and is incredibly useful for business. Here are the main ones:</p>
<ul>
<li dir="ltr" aria-level="1">
<p dir="ltr" role="presentation"><strong>Shapes</strong>. Often used in visual analytics, with different symbols representing different figures. Think circles representing cities on a map, and stars representing state capitals. <br><br></p>
</li>
<li dir="ltr" aria-level="1">
<p dir="ltr" role="presentation"><strong>Size, Length and Width</strong>. Using the example above, large cities on maps tend to be larger circles than small circles. In the instance of a bar chart, length and width is always associated with a corresponding change in quantity. <br><br></p>
</li>
<li dir="ltr" aria-level="1">
<p dir="ltr" role="presentation"><strong>Color</strong>. Referred to both in hue and intensity, color can quickly show what direction something is moving (often spreadsheets have negative numbers in red) and by how much, with the saturation of a color on a heatmap or chart often corresponding to a numeric threshold. <br><br></p>
</li>
<li dir="ltr" aria-level="1">
<p dir="ltr" role="presentation"><strong>Position and Grouping</strong>. By clustering or grouping data points, you can make it easy to instantly identify data by type or source. A venn diagram would be the most basic of these.&nbsp;</p>
</li>
</ul>
<p>&nbsp;</p>
<p><img style="display: block; margin-left: auto; margin-right: auto;" src="data:image/png;base64," width="564" height="317"></p>
<p dir="ltr" style="text-align: center;"><span style="font-size: 10pt;"><em>The scatter plot above uses color, size and distribution to show the frequency and amount of tips relative to bill totals. (Source: Row64)</em></span></p>
<p>&nbsp;</p>
<h2 dir="ltr">Visual Analytics by Time&nbsp;</h2>
<p dir="ltr">Within visual analytics, there&rsquo;s both descriptive analytics &mdash; which attempts to find the cause behind something that&rsquo;s already occurred, and prescriptive analytics and predictive analytics, which aim to create action plans based on the insights from past data.&nbsp;</p>
<p dir="ltr">The main difference between prescriptive analytics and predictive analytics is that prescriptive analytics is based on creating a solution for the present state (for instance a reactive marketing campaign operating in real time) and predictive analytics attempts to create a strategy for an event that has yet to occur (for instance a product to market launch).&nbsp;&nbsp;</p>
<h2 dir="ltr">Interactive vs Static Visual Analytics&nbsp;</h2>
<p dir="ltr">One of the most popular developments in visual analytics is the use of interactive data visualizations. Like their name suggests, these allow the user to drill down, manipulate or segment their data in real time, all within a visual interface.&nbsp;</p>
<p><strong>&nbsp;</strong></p>
<p dir="ltr">Examples of this include clicking on a state or county to zoom in on a map, highlight a section of a pie chart to reveal its sub sections, or highlight specific cells by data type or source. Interactive visual analytics are very common on data dashboards.&nbsp;</p>
<p><strong>&nbsp;</strong></p>
<div style="width:100%"><img src="https://lh6.googleusercontent.com/Ec9UckjAe-NuWztPKstFElvEBuaUu4I_pEEQJU7s0qbKtNBzr-hTFUkOrbDhmGrTcyWCP7vyS2mPJiG697Y28eQd9u75QY6gIAUh1wtTKSquZZt-Y1QJX9KeNmOdVdZCCtMqJTMn-IJvz_WIV035bRE" width="624" height="345" style="margin-left:163px"></div>
<h2 dir="ltr">Best Tools for Visual Analytics&nbsp;</h2>
<p dir="ltr">While visual analytics can come from anywhere or be made by anyone, they tend to be associated with software that does much of the work for the user. Many of these programs provide much of the same output, with the main factors being their integration with the cloud, the level of detail in their graphics, and how they are used across a team.&nbsp;</p>
<p><strong>&nbsp;</strong></p>
<p dir="ltr">While both visual analytics and data visualization are growing fields,&nbsp;</p>
<p><strong>&nbsp;</strong></p>
<ol>
<li dir="ltr" aria-level="1">
<p dir="ltr" role="presentation"><a href="https://www.tableau.com/products/desktop">Tableau</a>. Tableau is arguably the name in visual analytics, with several courses being taught dedicated to its specific software. Tableau can create most any type of data visualization &mdash; including scatter plots, Ganntt charts, tables, and maps &mdash; and can work both for data visualization, as well as an interactive data dashboard - including use as a CRM. <br><br></p>
</li>
<li dir="ltr" aria-level="1">
<p dir="ltr" role="presentation"><a href="https://www.qlik.com/us/data-visualization/visual-analytics">Qlik</a>. One of the newer visual analytics platforms out there, Qlik offers less complex data visualization options than Tableau, but is well suited for a business professional that wants a streamlined platform to quickly view KPI progress or inventory levels. It also requires less in-depth training than Tableau. <br><br></p>
</li>
<li dir="ltr" aria-level="1">
<p dir="ltr" role="presentation"><a href="https://www.sas.com/en_us/home.html">Sas Viya</a>. Sas Viya is great for users who aren&rsquo;t interested in creating custom data visualizations but want a suite of AI, analytics and data management, all presented to them in an easy to view dashboard. Sas Viya is cloud-native making it a great option for enterprise business looking to unify insights across teams. <br><br></p>
</li>
<li dir="ltr" aria-level="1">
<p dir="ltr" role="presentation"><a href="https://www.sisense.com/get/demo/">SiSense Fusion</a>. SiSense is one of the newer companies in the visual analytics space, and is making a name for itself as a no-code predictive analytics platform. Their cloud based data platform is designed for users with no data science background who want to easily look at the same data insights. <br><br></p>
</li>
<li dir="ltr" aria-level="1">
<p dir="ltr" role="presentation"><a href="/DataViz/">Row64.</a> What sets Row64 apart from other platforms is the speed and scale of its software. By borrowing a page from the world of gaming and 3D modeling, Row64 harnesses the power of your computer&rsquo;s GPU to be able to render millions of points in real time. While not a true data dashboard, the ability to render visualizations from the largest of spreadsheets, Row64 is one of the only platforms equipped to handle the size of modern data&mdash;with raytracing capabilities far beyond what anyone else is offering.&nbsp;&nbsp;</p>
</li>
</ol>
